let ShowTableHeaderInstance = null;
module.exports = class ShowTableHeader {
    constructor() {
        if (!ShowTableHeaderInstance) {
            ShowTableHeaderInstance = this;
            this.displayAs = 'Show Header';
            this.value = 'header'
            this.type = 'TOGGLE';
            this.values = {
                'true-value': true,
                'false-value': ''
            }
        }
        return ShowTableHeaderInstance;
    }
}
